angular.module('app.controllers', [])
  
.controller('resultadosCtrl', ['$scope', '$stateParams', '$http', '$rootScope',// The following is the constructor function for this page's controller. See https://docs.angularjs.org/guide/controller
// You can include any angular dependencies as parameters for this function
// TIP: Access Route Parameters for your page via $stateParams.parameterName
function ($scope, $stateParams, $http, $rootScope) {
    

    var objeto = {userId: 1};

    $http({
    	method: 'POST',
    	url: 'http://localhost:8080/api/results/getResults',
    	data: objeto
    }).then(function successCallback(response){
    	$scope.results = response.data;
    }, function errorCallback(response){
    	console.log("ERROR");
    });

    $scope.select = function(index){
    	$rootScope.selectedResult = $scope.results[index];
    	$rootScope.selectedResult.notificationDatetime.replace("T"," - ");
    	$rootScope.selectedResult.notificationDatetime.replace("Z"," ");
    };



          
 

}])
   
